import React, { Component } from "react";
import { Statistic } from "semantic-ui-react";

const UserAnalytics = () => {

  return (
    <Statistic.Group >
      <Statistic color='red'>
        <Statistic.Value>27</Statistic.Value>
        <Statistic.Label>red</Statistic.Label>
      </Statistic>

    </Statistic.Group>
  );
}
export default UserAnalytics;
